import styles from './UserList.module.css'
import { store } from '../../app/store'
import { UserType } from '../../types'

const UserList = () => {
  const users: UserType[] = store.getState().usersReducers
  console.log(users)

  const usersTableRows: JSX.Element[] = []

  // eslint-disable-next-line array-callback-return
  users.map(user => {
    usersTableRows.push(
      <tr key={user.id}>
        <td> {user.name} </td>
        <td> {user.surname} </td>
        <td> {user.e_mail} </td>
      </tr>
    )
  })

  return (
    <div> 
      <thead>

      </thead>
      <tbody>
        <table>
          {usersTableRows}
        </table>
      </tbody>
    </div>
  )
}

export default UserList
